import * as React from 'react';
import Box from '@mui/material/Box';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

export default function SkillSelector() {
  const [skill, setSkill] = React.useState('');

  const handleChange = (event) => {
    setSkill(event.target.value);
  };

  return (
    <Box sx={{ minWidth: 120 }}>
      <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">Skill</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={skill}
          label="Skill"
          onChange={handleChange}
        >
          <MenuItem value={"Teamwork"}>Teamwork</MenuItem>
          <MenuItem value={"Office Information"}>Office Information"</MenuItem>
          <MenuItem value={"Document Writing"}>Document Writing</MenuItem>
          <MenuItem value={"Problem Solving"}>Problem Solving</MenuItem>
          <MenuItem value={"Project Manager"}>Project Manager</MenuItem>
        </Select>
      </FormControl>
    </Box>
  );
}
